     * 69
     * > digitsum("woArBld")
     * 131
     * > digitsum("aAaaaXa")
     * 153
     * > digitsum(" How are yOu?")
     * 151
     * > digitsum("You arE Very Smart")
     * 327
     */
    public static int digitsum(String s) {
        int sum = 0;
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if (c >= 'A' && c <= 'Z') {
                sum += c;
            }
        }
        return sum;
    }
}

