class SortArray {

    /**
     * * In this Kata, you have to sort an array of non-negative integers according to
     * number of ones in their binary representation in ascending order.
     * For similar number of ones, sort based on decimal value.
     *
     * It must be implemented like this:
     * >>> sort_array([1, 5, 2, 3, 4]) == [1, 2, 3, 4, 5]
     * >>> sort_array([-2, -3, -4, -5, -6]) == [-6, -5, -4, -3, -2]
     * >>> sort_array([1, 0, 2, 3, 4]) [0, 1, 2, 3, 4]
     *
     * > sortArray([1, 5, 2, 3, 4])
     * [1, 2, 4, 3, 5]
     * > sortArray([-2, -3, -4, -5, -6])
     * [-4, -2, -6, -5, -3]
     * > sortArray([1, 0, 2, 3, 4])
     * [0, 1, 2, 4, 3]
     * > sortArray([])
     * []
     * > sortArray([2, 5, 77, 4, 5, 3, 5, 7, 2, 3, 4])
     * [2, 2, 4, 4, 3, 3, 5, 5, 5, 7, 77]
     * > sortArray([3, 6, 44, 12, 32, 5])
     * [32, 3, 5, 6, 12, 44]
     * > sortArray([2, 4, 8, 16, 32])
     * [2, 4, 8, 16, 32]
     * > sortArray([2, 4, 8, 16, 32])
     * [2, 4, 8, 16, 32]
     */
    public static List<Object> sortArray(List<Object> arr) {
        List<Object> sorted = new ArrayList<Object>();
        for (int i = 0; i < arr.size(); i++) {
            int num = ((Number) arr.get(i)).intValue();
            int ones = 0;
            while (num > 0) {
                ones += num % 2;
                num /= 2;
            }
            sorted.add(new int[] { ones, ((Number) arr.get(i)).intValue() });
        }
        Collections.sort(sorted, new Comparator<Object>() {

            public int compare(Object o1, Object o2) {
                int[] a1 = (int[]) o1;
                int[] a2 = (int[]) o2;
                if (a1[0] == a2[0]) {
                    return a1[1] - a2[1];
                }
                return a1[0] - a2[0];
            }
        });
        List<Object> result = new ArrayList<Object>();
        for (int i = 0; i < sorted.size(); i++) {
            result.add(((int[]) sorted.get(i))[1]);
        }
        return result;
    }
}

